using System;
using System.Collections.Generic;
using System.Linq;
using System.Reflection.Emit;
using System.Text;
using System.IO;
using Xamarin.Forms;
using System.Threading;
using System.Diagnostics.Contracts;
using System.Threading.Tasks;

namespace Gra_Miejska
{
    
    public class WelcomePage : ContentPage
    {
        static string base64image = "";
        static byte[] EncodedDataAsByte = System.Convert.FromBase64String(base64image);
        static Image Logo = new Image { Source = ImageSource.FromStream(() => new MemoryStream(EncodedDataAsByte)), /*WidthRequest = 200, HeightRequest = 200,*/HorizontalOptions = LayoutOptions.FillAndExpand,VerticalOptions = LayoutOptions.FillAndExpand };

        public WelcomePage()
        {
            
            Style = (Style)Styles.styles["siteStyle"];
            StackLayout stack = new StackLayout
            {
                HorizontalOptions = LayoutOptions.Center,
                VerticalOptions = LayoutOptions.Center,

                Children = {
					Logo                    
				}
            };
            Content = stack;
            

        }
        protected override void OnAppearing()
        {
            Device.StartTimer(TimeSpan.FromSeconds(2), () =>
            {
                Navigation.PushAsync(new LoginPage());
                return false; //not continue
            });
            base.OnAppearing();
        }
    }
}
